--
-- Table structure for table `borrowers`
--

CREATE TABLE `borrowers` (
  `id` int(11) NOT NULL,
  `user_id` int(11) NOT NULL,
  `book_id` int(11) NOT NULL,
  `borrow_date` datetime NOT NULL DEFAULT current_timestamp(),
  `due_date` date NOT NULL,
  `copies_identifier` varchar(255) NOT NULL,
  `librarian` varchar(255) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

--
-- Triggers `borrowers`
--
DELIMITER $$
CREATE TRIGGER `before_insert_borrower` BEFORE INSERT ON `borrowers` FOR EACH ROW BEGIN

    DECLARE next_identifier INT;

    DECLARE last_identifier INT;

    DECLARE found_gap BOOLEAN DEFAULT FALSE;



    -- Find the highest identifier for the current book_id

    SELECT IFNULL(MAX(SUBSTRING_INDEX(copies_identifier, '_', -1)), 0)

    INTO last_identifier

    FROM borrowers

    WHERE book_id = NEW.book_id;



    -- Start from 1 if no entries exist for the given book_id

    IF last_identifier = 0 THEN

        SET next_identifier = 1;

    ELSE

        -- Look for any gaps in the sequence by checking for the next available identifier

        SET next_identifier = 1;

        WHILE NOT found_gap DO

            -- Check if the identifier exists for the current book_id

            IF NOT EXISTS (SELECT 1 FROM borrowers WHERE book_id = NEW.book_id AND copies_identifier = CONCAT(NEW.book_id, '_copy_', next_identifier)) THEN

                SET found_gap = TRUE;

            ELSE

                SET next_identifier = next_identifier + 1;

            END IF;

        END WHILE;

    END IF;



    -- Set the copies_identifier in the format 'book_id_copy_identifier'

    SET NEW.copies_identifier = CONCAT(NEW.book_id, '_copy_', next_identifier);

END
$$
DELIMITER ;

