--
-- Table structure for table `reservations`
--

CREATE TABLE `reservations` (
  `id` int(11) NOT NULL,
  `user_id` int(11) NOT NULL,
  `book_id` int(11) NOT NULL,
  `reservation_date` datetime NOT NULL,
  `reservation_date_expiration` datetime DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

--
-- Triggers `reservations`
--
DELIMITER $$
CREATE TRIGGER `after_reservation_expiration` AFTER UPDATE ON `reservations` FOR EACH ROW BEGIN

    -- Check if the reservation has expired and if the current time is greater than reservation_date_expiration

    IF NEW.reservation_date_expiration <= CONVERT_TZ(NOW(), '+00:00', '+08:00') THEN

        -- Delete the reservation record

        DELETE FROM reservations WHERE id = NEW.id;

        

        -- Increment the Copies_Available in the books table based on the Book_ID in the reservations table

        UPDATE books 

        SET Copies_Available = Copies_Available + 1

        WHERE Book_ID = NEW.book_id;

    END IF;

END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `set_reservation_expiration` BEFORE INSERT ON `reservations` FOR EACH ROW BEGIN

    SET NEW.reservation_date_expiration = DATE_ADD(NEW.reservation_date, INTERVAL 48 HOUR);

END
$$
DELIMITER ;

